import React, { useState, useEffect } from 'react';
import { useAuth } from './AuthContext';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const Dashboard = () => {
    const { auth, logout } = useAuth();
    const navigate = useNavigate();
    const [quote, setQuote] = useState('');
    const [joke, setJoke] = useState('');
    const [isEditing, setIsEditing] = useState(false);
    const [profile, setProfile] = useState({
        name: auth?.user?.username || '',
        email: auth?.user?.email || '',
        signupDate: auth?.user?.createdAt || new Date().toISOString()
    });

    useEffect(() => {
        const fetchDashboardData = async () => {
            try {
                // Fetch quote with proper response handling
                const quoteResponse = await axios.get('https://api.freeapi.app/api/v1/quotes/random');
                if (quoteResponse?.data?.data?.content) {
                    setQuote(quoteResponse.data.data.content);
                } else {
                    setQuote('Welcome to your dashboard!');
                }
                
                // Fetch joke with proper response handling
                const jokeResponse = await axios.get('https://api.freeapi.app/api/v1/jokes/random');
                if (jokeResponse?.data?.data?.content) {
                    setJoke(jokeResponse.data.data.content);
                } else {
                    setJoke('Loading your daily joke...');
                }
            } catch (error) {
                console.error('Error fetching dashboard data:', error);
                setQuote('Welcome to your dashboard!');
                setJoke('Check back later for your daily joke!');
            }
        };

        fetchDashboardData();
    }, []);

    const handleProfileUpdate = async (e) => {
        e.preventDefault();
        try {
            // API call to update profile would go here
            setIsEditing(false);
        } catch (error) {
            console.error('Error updating profile:', error);
        }
    };

    const handleLogout = () => {
        logout();
        navigate('/login');
    };

    return (
        <div className="min-h-screen bg-gray-100 p-6">
            <div className="max-w-4xl mx-auto space-y-6">
                {/* Welcome Section */}
                <div className="bg-white rounded-lg shadow p-6">
                    <h1 className="text-2xl font-bold mb-4">
                        Hello, {profile.name}!
                    </h1>
                    <p className="text-gray-600 italic">"{quote}"</p>
                </div>

                {/* Profile Section */}
                <div className="bg-white rounded-lg shadow p-6">
                    <div className="flex justify-between items-center mb-4">
                        <h2 className="text-xl font-semibold">Profile Information</h2>
                        <button 
                            onClick={() => setIsEditing(!isEditing)}
                            className="bg-blue-500 text-white px-4 py-2 rounded hover:bg-blue-600"
                        >
                            {isEditing ? 'Cancel' : 'Edit Profile'}
                        </button>
                    </div>

                    {isEditing ? (
                        <form onSubmit={handleProfileUpdate} className="space-y-4">
                            <div>
                                <label className="block text-sm font-medium text-gray-700">Name</label>
                                <input
                                    type="text"
                                    value={profile.name}
                                    onChange={(e) => setProfile({...profile, name: e.target.value})}
                                    className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
                                />
                            </div>
                            <div>
                                <label className="block text-sm font-medium text-gray-700">Email</label>
                                <input
                                    type="email"
                                    value={profile.email}
                                    onChange={(e) => setProfile({...profile, email: e.target.value})}
                                    className="mt-1 block w-full rounded-md border-gray-300 shadow-sm"
                                />
                            </div>
                            <button type="submit" className="bg-green-500 text-white px-4 py-2 rounded hover:bg-green-600">
                                Save Changes
                            </button>
                        </form>
                    ) : (
                        <div className="space-y-2">
                            <p><span className="font-medium">Name:</span> {profile.name}</p>
                            <p><span className="font-medium">Email:</span> {profile.email}</p>
                            <p><span className="font-medium">Member since:</span> {new Date(profile.signupDate).toLocaleDateString()}</p>
                        </div>
                    )}
                </div>

                {/* Joke Section */}
                <div className="bg-white rounded-lg shadow p-6">
                    <h2 className="text-xl font-semibold mb-4">Daily Joke</h2>
                    <p className="text-gray-600">{joke}</p>
                </div>

                {/* Logout Button */}
                <button 
                    onClick={handleLogout}
                    className="w-full bg-red-500 text-white px-4 py-2 rounded hover:bg-red-600"
                >
                    Logout
                </button>
            </div>
        </div>
    );
};

export default Dashboard;
